        .catch((error) => {
          this.errors = error.response.data.errors;
          this.quote_loading = false;
          swal("Oops...!", "Something went wrong, please try again!", "error");
          return error;
        });
    },
    formatPrice(price) {
      return new Intl.NumberFormat().format(price);
    },
